import "./styles.css";
import PieChart from "./components/PieChart";
import StyledTable from "./components/Table";
import Buttons from "./components/Buttons";
import React from "react";

const initialState = {
  currentDate: new Date(),
  personInfo: [],
};

const reducer = (state, action) => {
  switch (action.type) {
    case "INCREMENT":
      return { currentDate: initialState.currentDate + 1 };
  }
  return state;
};
const handleIncrease = () => {
  () => dispatch({ type: INCREMENT });
};

export default function App() {
  const [state, dispatch] = React.useReducer(reducer, initialState);
  const getData = () => {
    fetch(
      "/Users/mickey/Desktop/offline-test-template/public/data/vaccine_dates.json"
    )
      .then(function (response) {
        console.log(response);
        return response.json();
      })
      .then(function (myJson) {
        console.log(myJson);
      });
  };
  useEffect(() => {
    getData();
  }, []);

  return (
    <div className='App'>
      <h1>{state.currentDate}</h1>
      <div className='chart'>
        <PieChart data={[60, 40]} />
      </div>
      <div className='buttons'>
        <Buttons handleIncrease={handleIncrease} />
      </div>
      <b style={{ textAlign: "center" }}>
        X out of Y persons have been vaccinated.
      </b>
      <div className='table'>
        <StyledTable />
      </div>
    </div>
  );
}
